import React from "react";
import styled from "styled-components";
import Grid from "../index.js";
import Tag from "../../Input/index.js"
import data from "../../Data//korvaiDetail.js";

const ThalamGrid = styled(Grid)`
    grid-template-columns: repeat(${data.cols}, 1fr);
`;
const Index = () => {
    return <ThalamGrid>{data.poorvangam.map(tag => <Tag>{tag.value}</Tag>)}</ThalamGrid>; 
};
export default Index;
